// Navbar.js
import React from 'react';

const Navbar = () => {
    return (
        <nav style={{ backgroundColor: '#333', color: 'white', padding: '10px' }}>
            <h1>ViRix</h1>
            <p>Stay informed with the latest COVID-19 data</p>
        </nav>
    );
};

export default Navbar;
